import React from 'react';
import { Redirect } from 'react-router-dom';

const ErrorPage = (props) => {
  const { auth } = props

  if(auth === null){
    return <Redirect to='/loginpage' />
  }

  return(
    alert("Oops,Page Not Found!")
  )
}

export default ErrorPage;
